face_classifier = cv2.CascadeClassifier(
    r"C:\Users\satya\OneDrive\Documents\codechef_contest\ML Project-shareble\ML Project\haarcascade_frontalface_default.xml")
classifier = load_model(
    r"C:\Users\satya\OneDrive\Documents\codechef_contest\ML Project-shareble\ML Project\Emotion_little_vgg.h5")

class_labels = ['Angry', 'Happy', 'Neutral', 'Sad', 'Surprise']

frame = cv2_img
gray = cv2.cvtColor(frame, cv2.COLOR_BGR2GRAY)
faces = face_classifier.detectMultiScale(frame, 1.3, 5)
# print(faces, gray)
for (x, y, w, h) in faces:
    cv2.rectangle(frame, (x, y), (x+w, y+h), (255, 0, 0), 2)
    roi_gray = gray[y:y+h, x:x+w]
    roi_gray = cv2.resize(roi_gray, (48, 48), interpolation=cv2.INTER_AREA)
    print("some greyyyy")
    if np.sum([roi_gray]) != 0:
        roi = roi_gray.astype('float')/255.0
        roi = img_to_array(roi)
        roi = np.expand_dims(roi, axis=0)

        preds = classifier.predict(roi)[0]
        label = class_labels[preds.argmax()]
        print(label)
